import React from "react";
import "./style.css"
import {useSelector} from "react-redux";
import ContactItem from "../contact-item";
import LogItem from "../log-item";

const ContactList = () => {
    const contacts = useSelector(state => state.contactsList);


    // console.log("contacts data", data);
    let data = contacts.item !== undefined ? contacts.item[0].data.reduce((r, e) => {
        // get first letter of name of current element
        let group = e.name[0];
        // if there is no property in accumulator with this letter create it
        if (!r[group]) r[group] = {group, children: [e]};
        // if there is push current element to children array for that letter
        else r[group].children.push(e);
        // return accumulator
        return r;
    }, {}) : null;
    const _renderLogs = () => {

        console.log("ssssssssssssss", data)
        return (
            data !== undefined ? data !== null ? Object.values(data).map((item, i) => (
                <div key={i}>
                    <p>{item.group}</p>
                    {item.children.map((item, index) => (
                        <div><span>{item.name}</span>
                            <span>{item.internal_number}</span></div>
                    ))}
                </div>
            )) : null : null

        )
    };
    return (
        <React.Fragment>
            <p className="tab-title">مخاطبین</p>

            {
                _renderLogs()

            }
        </React.Fragment>
    )
};
export default ContactList;
